import React, { Component } from 'react';
import axios from 'axios';

export default class GetCars extends Component {

    state = {
    }

    async componentDidMount() {
        const res = await axios.get("http://localhost:8090/cars/getAll");
        console.log(res)
    }

    render() {
        return (
            <div className="container">
                <div className="row">
                    <div className="col-md-4 mt-5">
                        <div className="card card-body">
                            <h3>
                                Get All Cars
                            </h3>
                            <form>
                                <div className="form-group">
                                    <label for="startDate">Start Date</label>
                                    <input type="text" className="form-control" id="startDate" aria-describedby="dateHelp" placeholder="YYYY-MM-DD" />
                                </div>
                                <div className="form-group">
                                    <label for="endDate">End Date</label>
                                    <input type="text" className="form-control" id="endDate" aria-describedby="dateHelp" placeholder="YYYY-MM-DD" />
                                </div>
                                <small id="datelHelp" className="form-text text-muted">Type the start and end date to get the cars</small>
                                <div className="form-group mt-1">
                                    <select className="custom-select form-control" id="className">
                                        <option value="null" selected>Choose a car class</option>
                                        <option value="Sedan">Sedan</option>
                                        <option value="Compact">Compact</option>
                                        <option value="Pick Up">Pick Up</option>
                                        <option value="Sport">Sport</option>
                                    </select>
                                </div>

                                
                                <button type="submit" className="btn btn-primary mt-3">Consult</button>
                            </form>
                        </div>
                    </div>
                    <div className="col-md8">
                        <ul className="list-group">
                            {
                                this
                            }
                        </ul>
                    </div>
                </div>
            </div>
        )
    };
}
